import {
  HiOutlineViewGrid,
  HiOutlineCube,
  HiOutlineShoppingCart,
  HiOutlineUsers,
  HiOutlineDocumentText,
  HiOutlineAnnotation,
  HiOutlineQuestionMarkCircle,
  HiOutlineCog,
} from "react-icons/hi";
import { FaDoorOpen } from "react-icons/fa";
import { MdSpaceDashboard } from "react-icons/md";
import { IoCalendar } from "react-icons/io5";



export const DASHBOARD_SIDEBAR_LINKS = [
  {
    key: "dashboard",
    label: "Dashboard",
    path: "/",
    icon: <MdSpaceDashboard  />,
  },
  {
    key: "leave",
    label: "Leave",
    path: "/leave",
    icon: <FaDoorOpen />,
  },
  {
    key: "attendance",
    label: "Attendance",
    path: "/attendance",
    icon: <IoCalendar  />,
  },
  {
    key: "myinfo",
    label: "My Info",
    path: "/myinfo",
    icon: <HiOutlineDocumentText />,
  },
  {
    key: "task",
    label: "Task",
    path: "/task",
    icon: <HiOutlineCube />,
  },
  {
    key: "customers",
    label: "Customers",
    path: "/customers",
    icon: <HiOutlineUsers />,
  },
  {
    key: "admin",
    label: "Admin",
    path: "/admin",
    icon: <HiOutlineCog />,
  },
  {
    key: "claim",
    label: "Claim",
    path: "/claim",
    icon: <HiOutlineQuestionMarkCircle />,
  },
];

export const DASHBOARD_SIDEBAR_BOTTOM_LINKS = [
  {
    key: "setting",
    label: "Settings",
    path: "/setting",
    icon: <HiOutlineCog />,
  },
  {
    key: "logout",
    label: "Log out",
    path: "/logout",
    icon: <HiOutlineQuestionMarkCircle />,
  },
];
